import Vue from 'vue'
Vue.component("PostLayout", () => import("/Users/arturo/Code/RESIDELIA/residelia-help/docs/.vuepress/components/PostLayout.vue"))

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/arturo/Code/RESIDELIA/residelia-help/docs/README.md").then(comp => {
        Vue.component("page-index", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    path: "/test.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/arturo/Code/RESIDELIA/residelia-help/docs/test.md").then(comp => {
        Vue.component("page-test", comp.default)
        next()
      })
    }
  },
  {
    path: "/welcome.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/arturo/Code/RESIDELIA/residelia-help/docs/welcome.md").then(comp => {
        Vue.component("page-welcome", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
